import '../components/counter/counter';

function counterPage() {
    return ( 
        <div>
            <div className='container mt-5'>

                <div className='row d-flex justify-content-center'>
                    <div className='col-md-6'>
                        <counter/>
                    </div>
                </div>

            </div>
        </div>
     );
}

export default counterPage;
